Photos by @amivitale. Today is World Ranger Day and an opportunity to support the people whose unwavering commitment protects our most precious creatures and the habitat they need to survive. In these photos taken in Kenya, Kamara shares a moment with Kilifi at @lewa_wildlife; Lkalatian Lopeta, a Samburu wildlife ranger rescues the two-week-old Kinya who had fallen into a well with @r.e.s.c.u.e, women rangers at Kalepo conservancy,  Rangers look after Najin at @olpejeta conservancy, Yusuf watches over Kilifi and other young rhinos at @lewa_wildlife; Ruko Community Conservancy Ranger Mike Parkei carries food for 8 stranded giraffes with @savegiraffesnow; Mary, Naomi and Joseph care for a new orphan at @r.e.s.c.u.e , @zacharia443, head rhino keeper at @olpejeta looks after Ringo,  an orphaned baby black rhino; @zacharia443 sits with Najin, one of the last two northern white rhinos  and wildlife rangers patrol with their dogs at @loisaba_conservancy conservancy

Please support these organizations and thank their rangers for the critical work they do. You can also get involved by joining the Wildlife Ranger Challenge, a race with one goal: to raise money to support thousands of rangers and threatened species across the continent, at WildlifeRangerChallenge.org or by taking part in @ebtsoyp's World Ranger Day celebration streaming all day today at globalbiofest.com/rangerday

